['#include <stdio.h>
#include <string.h>
#include <stdlib.h>

#define N 100000

char stg[N + 1];

struct info{
	int *a;
	int cnt;
} edge[N + 1];

int traverse(int u, int v){
	for(int i = 0; i < edge[u].cnt; i += 2){
		if(edge[u].a[i] == v){
			return i;
		}
	}
	return -1;
}

void rlc(int u, int v, int c1, int c2){
	edge[u].a = (int *) realloc(edge[u].a, c1 * sizeof(*edge[u].a));
	edge[v].a = (int *) realloc(edge[v].a, c2 * sizeof(*edge[v].a));	
}

void push(int u, int v, int l){
	int ind = traverse(u, v);
	int c1, c2;
	if(ind == -1){
		c1 = edge[u].cnt += 2;
		c2 = edge[v].cnt += 2;

		rlc(u, v, c1, c2);
		
		edge[u].a[c1 - 2] = v;
		edge[u].a[c1 - 1] = l;
		edge[v].a[c2 - 2] = u;
		edge[v].a[c2 - 1] = l;
	}
	
	else if(edge[u].a[ind + 1] > l){
		edge[u].a[ind + 1] = l;
		ind = traverse(v, u);
		edge[v].a[ind + 1] = l;
	}
}

int main() {
	
	int n, m, k;
	scanf("%d%d%d", &n, &m, &k);
	
	for(int i = 0; i < m; i++){
		int u, v, l;
		scanf("%d%d%d", &u, &v, &l);
		push(u, v, l);
	}

	memset(stg, 0, sizeof(stg));

	while(k--){
		int a;
		scanf("%d", &a);
		stg[a] = 1;
	}

	int ans = -1;
	for(int i = 1; i <= n; i++){
		if(stg[i] == 1){
			for(int j = 0; j < edge[i].cnt; j += 2){
				int s, t;
				s = edge[i].a[j];
				t = edge[i].a[j + 1];
				if(stg[s] == 0 && (ans == -1 || (ans > t))){
					ans = t;
				}
			}
		}
	}

	printf("%d\n", ans);


	return 0;
}']

