['#include <stdio.h>
#include <stdlib.h>
#include <string.h>

_Bool IsColoredPixel(char pixel)
{
	const char *COLORS = "CMY";
	if(strchr(COLORS, pixel) == NULL)
		return 0;
	return 1;
}

_Bool IsBlackAndWhite(char **picture, unsigned short height, unsigned short width)
{
	unsigned short i, j;
	for(i = 0; i < height; i++)
		for(j = 0; j < width; j++)
			if(IsColoredPixel(picture[i][j]))
				return 0;

	return 1;
}

void PrintPicture(char **picture, unsigned short height, unsigned short width)
{
	unsigned short i, j;
	for(i = 0; i < height; i++)
		for(j = 0; j < width; j++)
			printf("%c", picture[i][j]);
}

int main()
{
	unsigned short height, width;
	scanf("%hu %hu", &height, &width);

	char **picture = malloc(height * sizeof(char*));
	unsigned short i, j;
	for(i = 0; i < height; i++)
		picture[i] = malloc(width);

	char t;
	scanf("%c", &t);

	for(i = 0; i < height; i++)
		for(j = 0; j < width; j++)
			if(i == height - 1 && j == width - 1)
				scanf("%c", &picture[i][j]);
			else if(j == width - 1)
				scanf("%c\n", &picture[i][j]);
			else
				scanf("%c ", &picture[i][j]);

	//PrintPicture(picture, height, width);

	if(IsBlackAndWhite(picture, height, width))
		printf("#Black&White");
	else
		printf("#Color");

	for(i = 0; i < height; i++)
		free(picture[i]);
	free(picture);

	return 0;
}
