    {
        for(j=0; j<k; j++)
        {
            getchar();
            s[i][j]=getchar();

        }
    }
    c=0;
    for(i=0; i<m; i++)
    {
        for(j=0; j<k; j++)
        {
            if((s[i][j]=='W')||(s[i][j]=='B')||(s[i][j]=='G'))
            {
               c++;
            }
        }

    }
