            scanf("%c", &arr[i][j]);

            if(arr[i][j]=="C" || arr[i][j]=="M" || arr[i][j]=="Y")
            {
                flag=1;
                break;
            }

            if(flag==1)
                break;
        }

    if(flag==1)
        printf("#Colour");
    else
        printf("#Black&White");

    return 0;
